import { ChekitSpot } from "../resources/MapResources";


type SpotPopupProps = {
    spot: ChekitSpot;
}

const SpotPopup: React.FC<SpotPopupProps> = (props) => {
    return(
        <>
        <strong>
            {props.spot.name}
        </strong>
        <br />
        <p>
            {props.spot.recommendations && <em>{props.spot.recommendations}</em>}
        </p>
        </>
    )
};

export default SpotPopup;
